{'publishedAt': '2023-04-26T19:49:21Z', 'channelId': 'UC3gQ9lIiPQj7frT5CE5QyRA', 'title': 'Bolsonaro admite uso de entorpecentes na Polícia', 'description': 'O ex-presidente Jair Bolsonaro prestou depoimento hoje na sede da Polícia Federal (PF) em Brasília, no âmbito de um inquérito sobre as invasões ao Palácio do Planalto, Congresso Nacional e Supremo Tribunal Federal (STF) no dia 8 de janeiro. Interrogado acerca de uma publicação nas redes que alega fraude no sistema eleitoral brasileiro, Bolsonaro disse que usou medicamentos e agiu sem intenção. 
Ainda hoje, o presidente do Senado Federal, Rodrigo Pacheco, leu o pedido de abertura da Comissão Parlamentar Mista de Inquérito (CPMI) para apurar a invasão bolsonarista às sedes dos Três Poderes. A CPMI foi criada, faltando apenas a publicação do ato no Diário Oficial da União (DOU). A escalação especulada nos bastidores do PL conta com Carlos Portinho, Jorge Seif e Magno Malta no Senado Federal e Carlos Bolsonaro, André Fernandes e Alexandre Ramagem na Câmara dos Deputados.

